import React from 'react';
import './Footer.css';
import { Link } from 'react-router-dom';

const Footer = () => {
    const date = new Date();
    const year = date.getFullYear();

    return (
        <main className='footer'>
            <section>
                <div>
                    <h2>RGOLD <span style={{ color: "goldenrod" }}>GYM</span> </h2>
                </div>
                <div>
                    <p>Need Help?</p>
